import React, { useState } from "react";
import "./App.css";
import ChatWindow from "./components/ChatWindow";
import logo from './assets/partselect-logo.png';

function App() {

  return (
    <div className="App">
      <div className="heading">
        <div className="logo">
          <a href="https://www.partselect.com">
            <img src={logo} alt=""></img>
          </a>
        </div>
        <div className="title">
        Refrigerator and Dishwasher Chatbot
        </div>
        <div className="info">
          <div className="phone">
            Call: 1-866-319-8402
          </div>
          <div className="hours">
            <i>Mon-Sat 8am-9pm EST</i>
          </div>
        </div>
      </div>
        <ChatWindow/>
    </div>
  );
}

export default App;
